import React from 'react'
import Button from '../UI/Button'

export default function FileSubmitForm(props) {
  return (
    <>
        <h1>Drag a CSV file here</h1>
        <form method="POST" onChange={props.changeHandler} onSubmit={props.fileSubmitHandler} encType="multipart/form">
            <input type="file" id="" name="csv-file" className='hi'></input>
            <Button type="submit" message="Import a CSV"></Button>
        </form>
    </>
  )
}
